import './Main.css';

import { Container } from "react-bootstrap";

function Main(){
    return(
        <Container fluid>
            <div className = "main">
                <Container>
                    <h4 className = "uppercase">We are</h4>
                    <h1 className = "capitalize">Creative Digital Agency</h1>
                    <button className = "main-button"></button>
                </Container>
            </div>
        </Container>
    )
}

export default Main
